import SingleRecipe from './pages/SingleRecipe';

function App() {
  return (
    <div>
      <Home></Home>
      <Recipes></Recipes>
      <Default></Default>
      <SingleRecipe></SingleRecipe>
      <h1>Welcome to react app</h1>

    </div>
